import React, { Fragment, useState } from 'react'
import MetaData from '../layout/MetaData'

const Home = () => {
    const categories = [
        'Makanan',
        'Minuman',
        'Perlengkapan Rumah Tangga',
        'Kesehatan & Kecantikan',
        'Ibu & Anak',
    ]

    return (
        <Fragment>
            <MetaData title={''} />
            <div className="categories-home">
                {categories.map(category => (
                    <div
                        key={category}
                    >
                        {category}
                    </div>
                ))}
            </div>
        </Fragment>
    )
}

export default Home
